window.bookSummaryJSON = "<p>Some are born great, some achieve greatness, and some have greatness thrust upon them… when they stumble haphazardly into a foreign realm.<br> <br> In a world where runes hold unimaginable power, mere mortal and gifted artisan Nate must harness arcane magic to navigate treacherous paths, reveal the hidden truths of his own past, and discover the workings of the illusive ‘System’. <br> <br> No big deal. <br> <br> Emboldened by only his penknife and a weirdly profound understanding of runic sorcery, Nate must uncover if the path he has been thrust upon may spare his earthly existence. After all, why only leave your mark on one world… when you might leave it on two?</p>"; 
